import React, { useState, useEffect, Suspense, lazy } from 'react';
import './App.css';

// Lazy load the 3D components with error boundary
const WhaleVisualization = lazy(() => import('./components/WhaleVisualization').catch(() => {
  return { default: () => <div className="error-fallback">3D Visualization Unavailable</div> };
}));

const DataPanel = lazy(() => import('./components/DataPanel').catch(() => {
  return { default: () => <div className="error-fallback">Data Panel Unavailable</div> };
}));

const Controls = lazy(() => import('./components/Controls').catch(() => {
  return { default: () => <div className="error-fallback">Controls Unavailable</div> };
}));

const DemoMode = lazy(() => import('./components/DemoMode').catch(() => {
  return { default: () => null };
}));

function App() {
  const [whaleData, setWhaleData] = useState([]);
  const [summaryData, setSummaryData] = useState(null);
  const [blockData, setBlockData] = useState([]);
  const [config, setConfig] = useState({ threshold: 100, interval: 60 });
  const [isConnected, setIsConnected] = useState(false);
  const [show3D, setShow3D] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    console.log('React App mounted successfully!');
    
    // Test SSE connection
    const eventSource = new EventSource('/stream');
    
    eventSource.addEventListener('hello', () => {
      console.log('SSE connected!');
      setIsConnected(true);
      fetchConfig();
    });

    eventSource.addEventListener('whale', (event) => {
      try {
        const data = JSON.parse(event.data);
        setWhaleData(prev => [data, ...prev.slice(0, 49)]);
      } catch (err) {
        console.error('Error parsing whale data:', err);
      }
    });

    eventSource.addEventListener('summary', (event) => {
      try {
        const data = JSON.parse(event.data);
        setSummaryData(data);
      } catch (err) {
        console.error('Error parsing summary data:', err);
      }
    });

    eventSource.addEventListener('block', (event) => {
      try {
        const data = JSON.parse(event.data);
        setBlockData(prev => [data, ...prev.slice(0, 9)]);
      } catch (err) {
        console.error('Error parsing block data:', err);
      }
    });

    eventSource.addEventListener('config', (event) => {
      try {
        const data = JSON.parse(event.data);
        setConfig(data);
      } catch (err) {
        console.error('Error parsing config data:', err);
      }
    });

    eventSource.onerror = (error) => {
      console.log('SSE error:', error);
      setIsConnected(false);
    };

    return () => eventSource.close();
  }, []);

  const fetchConfig = async () => {
    try {
      const response = await fetch('/config');
      const data = await response.json();
      if (data.threshold !== null && data.interval !== null) {
        setConfig(data);
      }
    } catch (error) {
      console.error('Failed to fetch config:', error);
    }
  };

  const updateConfig = async (newConfig) => {
    try {
      const response = await fetch('/config', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(newConfig)
      });
      const data = await response.json();
      setConfig(data);
    } catch (error) {
      console.error('Failed to update config:', error);
    }
  };

  const handleDemoData = (eventType, data) => {
    switch (eventType) {
      case 'whale':
        setWhaleData(prev => [data, ...prev.slice(0, 49)]);
        break;
      case 'summary':
        setSummaryData(data);
        break;
      case 'block':
        setBlockData(prev => [data, ...prev.slice(0, 9)]);
        break;
      default:
        break;
    }
  };

  const toggle3D = () => {
    setShow3D(!show3D);
  };

  return (
    <div className="App">
      {/* Simple Test Mode */}
      <div className="test-container">
        <h1>🐋 WhaleWatch 3D</h1>
        <p>Real-time Bitcoin whale transaction monitoring</p>
        
        <div className={`connection-status ${isConnected ? 'connected' : 'disconnected'}`}>
          {isConnected ? '🟢 Connected to Backend' : '🔴 Disconnected - Demo Mode'}
        </div>

        <div className="controls-row">
          <button onClick={toggle3D} className="toggle-3d-btn">
            {show3D ? '🔄 Hide 3D View' : '🎮 Show 3D View'}
          </button>
        </div>

        {error && (
          <div className="error-message">
            <h3>⚠️ Error Loading 3D Components</h3>
            <p>{error}</p>
            <p>Try refreshing the page or check your browser's WebGL support.</p>
          </div>
        )}

        <div className="test-info">
          <h3>📊 Live Data</h3>
          <ul>
            <li>React App: ✅ Loaded</li>
            <li>Backend Connection: {isConnected ? '✅ Connected' : '❌ Not Connected'}</li>
            <li>Whale Transactions: {whaleData.length}</li>
            <li>Recent Blocks: {blockData.length}</li>
            <li>3D Mode: {show3D ? '🟢 Active' : '⚪ Inactive'}</li>
          </ul>
        </div>

        {/* Simple Data Display */}
        <div className="simple-data">
          <h3>🐋 Recent Whale Transactions</h3>
          <div className="whale-list">
            {whaleData.slice(0, 5).map((whale, index) => (
              <div key={index} className="whale-item">
                <span className="whale-value">{whale.value_btc.toFixed(2)} BTC</span>
                <span className="whale-time">{new Date(whale.timestamp).toLocaleTimeString()}</span>
              </div>
            ))}
            {whaleData.length === 0 && <p>No whale transactions yet...</p>}
          </div>
        </div>
      </div>

      {/* 3D Visualization (Conditional) */}
      {show3D && (
        <Suspense fallback={<div className="loading-3d">Loading 3D Visualization...</div>}>
          <div className="canvas-container">
            <div className="canvas-wrapper">
              <div className="canvas-placeholder">
                <h3>🎮 3D Visualization</h3>
                <p>3D components are loading...</p>
                <p>This may take a moment on slower devices.</p>
              </div>
            </div>
          </div>
        </Suspense>
      )}

      {/* Demo Mode Component */}
      <Suspense fallback={null}>
        <DemoMode onDataUpdate={handleDemoData} />
      </Suspense>
    </div>
  );
}

export default App;
